  const { data } = useGetSeller(user.id);

  useEffect(() => {
      myFunction();
      return () => {
        setupdate({}); // This worked for me
      };
  }, []);

  const myFunction = () => {
      setupdate(data)
      console.log("PICOOOO", update)
  }



  //setupdate(data[0])
  return (
    <div>
      {" "}
      <Grid container spacing={gridSpacing}>
        <Grid item lg={12} md={12} sm={12} xs={12}>
          <SellerListTools oculto={oculto} setoculto={setoculto} />
        </Grid>
        <Grid item lg={12} md={12} sm={12} xs={12}>
          {oculto.hiddentable ? <SellerListTable  setupdate={setupdate} idcliente={user.id} update={update} /> : null}
        </Grid>
        {oculto.hiddenperfilform ? (
          <>
            <Grid item lg={12} md={12} sm={12} xs={12}>
              <SellerStoreForm update={update} setoculto={setoculto} idcliente={user.id} />
            </Grid>
            <Grid item lg={12} md={12} sm={12} xs={12}>
              <SellerStoreFiles skus="legales" idcliente={user.id} />
            </Grid>
            <Grid item lg={12} md={12} sm={12} xs={12}>
              <Lister idcliente={user.id} codigo="legales" />
            </Grid>
          </>
        ) : null}
      </Grid>
    </div>
  );
}
